import React, { useEffect, useState } from 'react';
import { connect, useDispatch } from 'react-redux';
import axios from 'axios';
import { setCategoryList } from '../redux/actions/productActions';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import { Typography, List, ListItem, ListItemText } from '@mui/material';

const CategoryList = (props) => {
  const { categoryList, setCategoryList } = props;
  const categoryId = window.location.pathname.split("/")[2];
  const [category, setCategory] = useState({});
  const dispatch = useDispatch();
  const [isLoading, setIsLoading] = useState(true);

  const fetchCategoryList = async () => {
    try {
      const resp = await axios.get('http://localhost:3001/dietCategories');
      if (resp && resp.status === 200) {
        const decodedCategories = resp.data.map((categoryList) => {
          const base64Image = `data:image/jpeg;base64,${categoryList.categoryImage}`;
          return {
            ...categoryList,
            categoryImage: base64Image
          };
        });
        dispatch(setCategoryList(decodedCategories));
      }
    } catch (error) {
      console.log('Error:', error);
    } finally {
      setIsLoading(false);
    }
  };

  useEffect(() => {
    fetchCategoryList();
  }, []);

  useEffect(() => {
    const getCategoryId = () => {
      categoryList &&
        categoryList.forEach((category) => {
          if (categoryId === category.categoryId) {
            setCategory(category);
            return;
          }
        });
    };

    if (Object.keys(category).length === 0) {
      getCategoryId();
    }
  }, [categoryList, categoryId]);

  return (
    <div>
      <h1>Category Detail</h1>
      <Paper elevation={10} style={{ marginTop: "50px", marginBottom: "80px", height: "950px" }}>
        <Grid container spacing={2}>
          <Grid item xs={12} sm={4} style={{ color: "#9c27b0" }}>
            <Typography variant="h4" component="h2">{category.categoryName}</Typography>
            {isLoading ? (
              <div>Loading image...</div>
            ) : (
              category.categoryImage && (
                <img src={category.categoryImage} alt="Category" onLoad={() => console.log("Image loaded")} style={{ width: '100%' }} />
              )
            )}
            <Typography variant="h6" component="p" style={{ marginTop: '20px' }}>{category.description}</Typography>
            <Typography variant="h6" component="p" style={{ marginTop: '20px' }}>Planlar:</Typography>
            {category.dailyDietPlan && category.dailyDietPlan.map((plan, index) => (
              <List key={index} style={{ marginBottom: '20px' }}>
                <ListItem>
                  <ListItemText primary={`${plan.ageRange} yaş aralığı`} />
                </ListItem>
                <ListItem>
                  <ListItemText primary={`Kahvaltı: ${plan.programDetails.breakfast}`} />
                </ListItem>
                <ListItem>
                  <ListItemText primary={`Öğle Yemeği: ${plan.programDetails.lunch}`} />
                </ListItem>
                <ListItem>
                  <ListItemText primary={`Akşam Yemeği: ${plan.programDetails.dinner}`} />
                </ListItem>
                <ListItem>
                  <ListItemText primary={`Ara Öğün: ${plan.programDetails.snack}`} />
                </ListItem>
                <ListItem>
                  <ListItemText primary={`Günlük Su Tüketimi: ${plan.programDetails.amountofWater}`} />
                </ListItem>
              </List>
            ))}
          </Grid>
        </Grid>
      </Paper>
    </div>
  );
};

const mapStateToProps = (state) => ({
  categoryList: state.categoryList.categoryList,
});

const mapDispatchToProps = {
  setCategoryList,
};

export default connect(mapStateToProps, mapDispatchToProps)(CategoryList);
